import { useEffect, useState } from "react"
import { useSelector } from 'react-redux'
const Contacts = () => {
    const { users } = useSelector(state => state.contacts)

    return
    {
        users.length && users.map((user, i) => {
            return <li>{user.name}</li>
        })

    }



}
export default Contacts
